webpackJsonp([0xd545e17340f8],{609:function(e,t){e.exports={data:{site:{siteMetadata:{githubRepo:"https://github.com/esttorhe/esttorhe.github.io",author:"Esteban Torres"}},markdownRemark:{frontmatter:{title:"ğŸ“¦ Wrapping up 2016",issueNumber:28,categories:["personal","yearly"],tags:["personal","growth","oss","life","new year"],author:null,date:"2016-12-16T14:08:08.000Z"},html:'<p>I\'ve been away for quite some time now and a lot of things have changed since I last had the time to blog.</p>\n<p>I\'ll try to detail everything that has happened in my life in the past few months and also prepare for my yearly wrap-up post.</p>\n<!--more-->\n<h1 id="brewbot-"><a href="#brewbot-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><code>Brewbot</code> ğŸºğŸ¤–</h1>\n<p>Last time I blogged I was working for <a href="https://brewbot.io"><code>Brewbot</code></a> and living in ğŸ‡¨ğŸ‡· (I\'ll cover this part later).\nSadly things went south and as many startups ended up belly upâ€¦</p>\n<p>Details about how or why that happened are not importante honestly and I won\'t dwell too much into it; let\'s summarize it by saying that after I got the ğŸ‘¢I had to look for different options to keep my family and ğŸ  afloat.</p>\n<p>I worked for a couple of months with a friend on his company and then jumped to yet another agency for the time being.</p>\n<p>All of this was just temporarily because while I was at <a href="https://estebantorr.es/blog/2016/06/03/iOScon-2016/">iOScon</a> I bumped into Pedro; an <code>iOS</code> developer from <code>SoundCloud</code> that I\'ve met on <code>Twitter</code> before and who told me that <code>SoundCloud</code> was looking for <code>iOS</code> engineers if I was interested.</p>\n<p>The idea was interesting and exciting but I was enjoying what I was doing at the timeâ€¦ that was until the day before I was due to give my talk when I was informed that yet again I was not going to get paidâ€¦ and then I decided to start my process with <code>SoundCloud</code>.</p>\n<h4 id="tldr-version"><a href="#tldr-version" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>TL;DR version</h4>\n<p>I joined <code>SoundCloud</code> on October the 1stâ€¦</p>\n<h1 id="relocation"><a href="#relocation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Relocation</h1>\n<p>During the whole interview process me and my (by then girlfriend, wife now) discussed a lot about the implications of actually getting hired by <code>SoundCloud</code>; like having to relocate to ğŸ‡©ğŸ‡ª for example.</p>\n<p>After discussing all the pros and cons we were on board in case we ended up in that situation.</p>\n<p><strong><em>Spoiler alert</em></strong>\nWe ended up in that situation ğŸ˜\nThe visa process wasn\'t hard but wasn\'t smooth either due to the fact that I was the first costarrican to be relocated to ğŸ‡©ğŸ‡ª by <code>SoundCloud</code> and that prooved a little bit harder than anticipated.</p>\n<h3 id="hunting-for-an-apartment-"><a href="#hunting-for-an-apartment-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Hunting for an apartment ğŸ”«</h3>\n<p>I\'m not going to go into lots of details hereâ€¦ suffice to say that looking for the right apartmentâ€¦ scratch that; for <strong>A</strong> apartment is surprisingly hard in Berlinâ€¦ given that this is a city with a lot of movement, people coming and going the demand is high and getting an apartment felt like applying for a jobâ€¦ for your <em>first</em> jobâ€¦</p>\n<p>You try to give them a great impression (hard to do so given that you only talk with the real state agent while you are looking at the apartment with another 20 or so peopleâ€¦).\nIs hard to make a lasting good impression under this circumstances.</p>\n<p>It took us 2 months and a lot of frustration but we were able to get a nice apartment in Prenzlauer Berg ğŸ‰</p>\n<p>Now I get to come to the office riding my ğŸš² (As a side noteâ€¦ I came to the realisation that I haven\'t ridden a bike since I was 15 or soâ€¦ ğŸ˜­ I\'m feeling it ğŸ˜‚)</p>\n<h1 id="oss--conferences"><a href="#oss--conferences" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>OSS &#x26; Conferences</h1>\n<p>During the beginning of this year I had my mind and heart set on giving many conferences and contributing as much as possible with <code>OSS</code> projects (mine and others).</p>\n<p>I accomplished both of those resolutions to the point that I spoke at 3 different conferences pretty far away from home.</p>\n<ol>\n<li>iOScon â€¢ London, UK</li>\n<li>NSSpain â€¢ LogroÃ±o, Spain</li>\n<li>Mobilization â€¢ ÅÃ³dÅº, Poland</li>\n</ol>\n<p>And got involved in many different <code>OSS</code> projects.</p>\n<h2 id="now"><a href="#now" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Now</h2>\n<p>That being said I think I\'m going to step down from <code>OSS</code> for a while and will apply to far less conferences this year.</p>\n<p>Reasoning for this is:</p>\n<ul>\n<li>I feel like I\'m trying too hard to come up with nice and interesting topics for conferencesâ€¦ this shouldn\'t be the case. I should be talking about stuff that I\'m passionate about or that I like.\nI have one more topic I would love to talk about so I\'ll try to make it to at least one conference in 2017 where I\'ll hopefully be able to talk about this topic ğŸ˜„</li>\n<li>I\'ve stretched myself too thin trying to reach into a lot of <code>OSS</code> projects and lately I\'ve not been able to provide a decent response neither in time nor in quality; also given that now I have to commute I don\'t have as much Â«freeÂ» time and the one that I have I\'m spending it playing with my son as much as I can while he still enjoys it ğŸ˜„\nI want to apologize to all those maintainers of projects where I\'ve been given the responsability to help maintain the project; I\'ll stay as a supporter and will try to help every now and then but I won\'t be as devoted to it as I tried during the first half of the year.</li>\n</ul>\n<!--Markdown links references-->',url:"Wrapping-up-2017"}},pathContext:{id:"/home/travis/build/esttorhe/esttorhe.github.io/content/_posts/2016-12-16-Wrapping-up-2017.md absPath of file >>> MarkdownRemark"}}}});
